window.bookSummaryJSON = "<p>The Earl of Frome gets a shock when a gaggle of nosy bird watchers gang up on him. When one of them winds up dead, it doesn't look good for the Earl.&nbsp;</p> <p>Amateur baker Poppy Wilkinson gets embroiled in yet another murder mystery. It's a good thing she's got witchy powers as she has to solve a murder, try and learn more about her own mysterious beginnings, and turn out a winning cake, because it's cake week in the competition tent.</p> <p>From <i>USA Today</i> best-selling author Nancy Warren comes the fifth book in the witches baking series. Each book can be listened to alone. They feature no sex, gore, or bad language but lots of clues, some quirky humor, and recipes.</p>"; 
